    @test_int [tan(d + e*x)^5*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 21, (1/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e))*(sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2)))) + (b*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(2*sqrt(c)*e) - (b*(b^2 - 4*a*c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(16*c^(5/2)*e) + (b*(7*b^2 - 12*a*c)*(b^2 - 4*a*c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(256*c^(9/2)*e) - (1/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e))*(sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)) + b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2)))) + sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2)/e + (b*(b + 2*c*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(8*c^2*e) - (b*(7*b^2 - 12*a*c)*(b + 2*c*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(128*c^4*e) - (a + b*tan(d + e*x) + c*tan(d + e*x)^2)^(3/2)/(3*c*e) + (tan(d + e*x)^2*(a + b*tan(d + e*x) + c*tan(d + e*x)^2)^(3/2))/(5*c*e) + ((35*b^2 - 32*a*c - 42*b*c*tan(d + e*x))*(a + b*tan(d + e*x) + c*tan(d + e*x)^2)^(3/2))/(240*c^3*e)]
    @test_int [tan(d + e*x)^4*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 19, -((1/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e))*(sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b*sqrt(a^2 + b^2 - 2*a*c + c^2) - (b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))) + (sqrt(c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/e + ((b^2 - 4*a*c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(8*c^(3/2)*e) - ((b^2 - 4*a*c)*(5*b^2 - 4*a*c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(128*c^(7/2)*e) - (1/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e))*(sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b*sqrt(a^2 + b^2 - 2*a*c + c^2) + (b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2)))) - ((b + 2*c*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(4*c*e) + ((5*b^2 - 4*a*c)*(b + 2*c*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(64*c^3*e) - (5*b*(a + b*tan(d + e*x) + c*tan(d + e*x)^2)^(3/2))/(24*c^2*e) + (tan(d + e*x)*(a + b*tan(d + e*x) + c*tan(d + e*x)^2)^(3/2))/(4*c*e)]
    @test_int [tan(d + e*x)^3*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 16, -((sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e)) - (b*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(2*sqrt(c)*e) + (b*(b^2 - 4*a*c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(16*c^(5/2)*e) + (sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)) + b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) - sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2)/e - (b*(b + 2*c*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(8*c^2*e) + (a + b*tan(d + e*x) + c*tan(d + e*x)^2)^(3/2)/(3*c*e)]
    @test_int [tan(d + e*x)^2*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 10, (sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b*sqrt(a^2 + b^2 - 2*a*c + c^2) - (a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) - ((b^2 - 4*(a - 2*c)*c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(8*c^(3/2)*e) + (sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b*sqrt(a^2 + b^2 - 2*a*c + c^2) + (a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) + ((b + 2*c*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(4*c*e)]
    @test_int [tan(d + e*x)^1*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 10, (sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) + (b*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(2*sqrt(c)*e) - (sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)) + b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) + sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2)/e]
    @test_int [tan(d + e*x)^0*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 9, -((sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b*sqrt(a^2 + b^2 - 2*a*c + c^2) - (b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e)) + (sqrt(c)*atanh((b + 2*c*tan(d + e*x))/(2*sqrt(c)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/e - (sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b*sqrt(a^2 + b^2 - 2*a*c + c^2) + (b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e)]
    @test_int [cot(d + e*x)^1*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 18, -((sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e)) - (sqrt(a)*atanh((2*a + b*tan(d + e*x))/(2*sqrt(a)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/e + (sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)) + b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e)]
    @test_int [cot(d + e*x)^2*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 17, (sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b*sqrt(a^2 + b^2 - 2*a*c + c^2) - (b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) - (b*atanh((2*a + b*tan(d + e*x))/(2*sqrt(a)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(2*sqrt(a)*e) + (sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b*sqrt(a^2 + b^2 - 2*a*c + c^2) + (b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) - (cot(d + e*x)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/e]
    @test_int [cot(d + e*x)^3*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2), x, 21, (sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*atan((b^2 + (a - c)*(a - c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c + sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c + sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) + (sqrt(a)*atanh((2*a + b*tan(d + e*x))/(2*sqrt(a)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/e + ((b^2 - 4*a*c)*atanh((2*a + b*tan(d + e*x))/(2*sqrt(a)*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(8*a^(3/2)*e) - (sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*atanh((b^2 + (a - c)*(a - c + sqrt(a^2 + b^2 - 2*a*c + c^2)) + b*sqrt(a^2 + b^2 - 2*a*c + c^2)*tan(d + e*x))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*sqrt(a^2 + b^2 + c*(c - sqrt(a^2 + b^2 - 2*a*c + c^2)) - a*(2*c - sqrt(a^2 + b^2 - 2*a*c + c^2)))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))))/(sqrt(2)*(a^2 + b^2 - 2*a*c + c^2)^(1/4)*e) - (cot(d + e*x)^2*(2*a + b*tan(d + e*x))*sqrt(a + b*tan(d + e*x) + c*tan(d + e*x)^2))/(4*a*e)]


